grid
const Items = () => {
    const dummyItem = {
        picLocaton:'./assets/dummy.jpeg',
        name: 'Dummy Item',
        description: 'This is a dummy item because it is a dummy',
    }

  return (
    <div className='items'>
        <ItemCard {...dummyItem}/>
        <ItemCard {...dummyItem}/>
        <ItemCard {...dummyItem}/>
        <ItemCard {...dummyItem}/>

    </div>
  )
}

export default Items
